import React from 'react'
import {Nav2} from './components/Nav2';

export const Reg = () => {
  return (
    <>
    <Nav2/>
    <h4 className='m-3'>SRIT-CS-6th Sem-A</h4>

    <div cla><button type="button" className="btn btn-secondary btn-lg m-auto" href='/'>Take Attendance</button></div>
    </>
  )
}

export default Reg
